export default class extends React.Component{

    Click = (genero) => {
        alert(genero);
      }

    render(){
        return(
           <div className='fondo'>
               {this.alerta}
               <ul>
                    <li>
                        <a href='' onClick={this.Click('Hombre')} className='text-dark'>Hombre</a>
                   </li>
                   <li id='mujer'>
                        <a id='mujer-letra' href='' onClick={this.Click('Mujer')} className='text-dark'>Mujer</a>
                   </li>
               </ul>
               <style jsx>
                   {`
                        .fondo{
                            box-shadow: 0px 0px 0px 3px;
                            width: 260px;
                            height: 33px;
                            text-align:center;
                        }

                       ul{
                           padding-left: 1px;
                       }

                        li{
                            display: inline-block;
                            margin-top: 5px;
                            margin-bottom: 5px;
                            margin-left: 15px;
                            margin-right: 15px;
                        }
                        a{
                            text-decoration: none;
                        }
                   `}
               </style>
           </div>
        );
    }
}
